import React from 'react';
import s from './MyPosts.module.css';
import {Post} from "./Post/Post";

type MyPostsType = {
    name: string
    message: string
    likes: string
}

export const MyPosts = (props: MyPostsType) => {

    let postData = [
        {name: 'Eduarda', message:'Hello', likes: '15'},
        {name: 'Artiom', message:'Good morning', likes: '20'}
    ]

    let getPostData = postData.map((ev)=>{
        return (
            <Post name={ev.name} message={ev.message} likes={ev.likes}/>
        )
    })
    return (
        <div className={s.posts}>
            <h3>My posts</h3>
            <div>
                <div>
                    <textarea></textarea>
                </div>
                <div>
                    <button>Add post</button>
                </div>
            </div>
            <Post name={'Eduarda'} message={'Hello!'} likes={'15 '}/>
            <Post name={'Artem'} message={'Good morning!'} likes={'20 '}/>
        </div>
    );
};
